import {
  NavBarStyle,
  LinkStyle,
  IconImage,
  ErrorDiv,
  ErrorLink,
} from "../styled-components/NavbarStyle";

import React from "react";
import { connect } from "react-redux";
import Login from "./Login";

function NavbarInfo(props) {
  return (
    <div>
      <NavBarStyle>
        {/* <LinkStyle to="/">Home</LinkStyle> 
        <LinkStyle to="/products">Products</LinkStyle>
        <LinkStyle to="/cart">Cart</LinkStyle>
        <LinkStyle to="/contact">Contact</LinkStyle>
        <LinkStyle to="/register">Register</LinkStyle> */}
        <LinkStyle to="/login">Login</LinkStyle>
        <LinkStyle to="/account">Account</LinkStyle>
      </NavBarStyle>

    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    isLoggedIn: state.isLoggedIn,
  };
};

export default connect(mapStateToProps)(NavbarInfo);
